import React, { useState, useEffect} from 'react'

function App() {
  const [data, setData] = useState({
    pagenum: "",
    age: 0,
  });
  useEffect(() => {
    fetch("/page1/").then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div>
      {(typeof data === 'undefined') ? (
        <p>Synching</p>
      ):(
        <p>{data}</p>
      )}
    </div>
  )
}

export default App;
